import React from 'react';
import styled from 'styled-components';

const Container = styled.main`
  background-color: #0C222F;
`;

const CardSet = styled.ul`
  display: flex;
  margin-top: 70px;
  flex-wrap: wrap;
  margin-left: 350px;
  margin-right: -30px;
  margin-bottom: -30px;
`;

const CardSetItem = styled.li`
  margin-right: 30px;
  margin-bottom: 30px;
`;

const CardSetLink = styled.a`
  display: block;
  text-decoration: none;
  color: inherit;
`;

const Card = styled.div`
  /* Стилі для карточки товару */
`;

function Goods() {
  return (
    <Container>
      <CardSet>
        <CardSetItem>
          <CardSetLink href="#">
            <Card>
              {/* Вміст карточки товару */}
            </Card>
          </CardSetLink>
        </CardSetItem>
        {/* Додайте решту карточок товарів */}
      </CardSet>
    </Container>
  );
}

export default Goods;
